import React, { Component } from 'react';

export default class Starter extends Component {

    state = {
        count: 0
    }



    render() {
        return (

            <React.Fragment>
                <h2 className='container'>Counter</h2>
                <button className="btn btn-primary">Increment</button>

                <p>{this.state.count}</p>

            </React.Fragment>

        )
    }


}
